    description:
      '<b>The LEGRIA HF S100 records Full HD video to SDHC memory cards, ideal for sharing. A range of advanced features combine with an 8.0MP CMOS sensor and DIGIC DV III to deliver superior picture quality.</b><br/><br/><b>Features</b><br/><br/>- 8.0MP Canon HD Camera System<br/>- SDHC Memory card recording<br/>- Instant AF and Super Range OIS<br/>- Manual control options<br/>- Video Snapshot, Face Detection, Pre REC<br/>- x.v.Colour and 25p<br/>- 8MP photos<br/>- Superior audio<br/>- Mini Advanced Accessory Shoe<br/>- Editing software <br/><br/>Supreme quality, advanced control.<br/><br/><b>Canon HD Camera System</b><br/>Superb HD images are delivered by a high resolution Canon HD Camera System: an 8.0MP Full HD CMOS sensor, a Canon HD Video Lens (58mm filter diameter) with 10x optical zoom and the DIGIC DV III processor.<br/><br/><b>Memory card recording</b><br/>Record directly to high capacity SDHC memory cards – a 32GB card can store over 12 hours of HD movies at the most efficient setting. For maximum quality, shoot at 24Mbps. Cards are perfect for sharing.<br/><br/><b>Essential shooting features</b><br/>Canon’s unique Instant AF system achieves incredibly accurate focus at speed. Super Range OIS combats almost all kinds of camera shake, keeping shots steady.<br/><br/><b>Advanced control</b><br/>A Custom Key lets you activate one of five variables which can be assigned to the manual Control Dial, including focus, exposure, and audio level. Further advanced controls include AGC (Auto Gain Control) limits – usually only found on professional camcorders, this boosts or limits responsiveness when shooting in low light – Zebra patterns, Colour Peaking and Colour Bar/Test Tone output.<br/><br/><b>Great videos made easy</b><br/>Video Snapshot limits each movie to 4 seconds – ideal for putting together in a playlist later. Play back your montage of video clips to a soundtrack of your choice. Face Detection Technology automatically optimises settings for perfect people shots, detecting up to 35 faces in a frame. Pre REC captures the 3 seconds of action before you press Record – so you never miss the shot.<br/><br/><b>Choose your colour</b><br/>DIGIC DV III supports x.v.Color – for deeper, richer hues when movies are played back on compatible HD TVs. 25p Cinema Mode matches the look of traditional film, and provides enhanced low-light shooting.<br/><br/><b>Still shooting</b><br/>A dedicated Photo mode allows users to capture high resolution still images, up to 8MP. In Dual Shot mode, 6MP stills can be shot during video recording. Photo Burst grabs 25 stills from a single second of recorded footage.<br/><br/><b>Better audio</b><br/>Capture and monitor superior audio using the microphone and headphone jacks. Manual audio level control provides even more options.<br/><br/><b>Expandable system</b><br/>Attach a range of optional peripherals to a mini Advanced Accessory Shoe, including a directional microphone and video light.<br/><br/><b>Software</b><br/>Easy-to-use PIXELA™ software is supplied for editing and sharing movies. With Canon’s DW-100 DVD Burner (available separately) burn DVDs at the touch of a button.',
