    description:
      "<b>The EF 100mm f/2.8L IS USM, part of Canon’s prestigious L series, and first featuring an Image Stabilizer with angle and shift detection that is highly effective at close focusing distances.</b><br/><br/><b>L series Quality</b><br/>The lens embodies Canon's highest standards of L-series optics, build quality, reliability and operability. A robust construction includes dust and moisture resistant seals to protect against harsh weather conditions.<br/><br/><b>Hybrid Image Stabilizer</b><br/>The new Image Stabilizer designed specifically for inclusion in a macro lens. It is able to correct lens shift movement as well as the angular movement that most IS systems can correct. This provides 2-stops of correction during 1.0x magnification, increasing to 3-stops at 0.5x magnification and 4-stops during normal shooting.<br/><br/><b>Ultra low dispersion (UD) lens element ensures high image quality</b><br/>A UD element within the lens design effectively removes chromatic aberration. This allows for excellent image quality with high resolution, high contrast and excellent colour reproduction.<br/><br/><b>Focus limiter switch</b><br/>To enhance the photographer’s use of the lens, it is fitted with a 3 position focus limiter switch. With limits for close up subjects, distant subjects and all subjects, the user is able to increase the autofocus speed making quick shots a possibility.<br/><br/><b>Beautiful background blur with 9 blade circular aperture</b><br/>A circular blade aperture helps to create attractive, even background bokeh when isolating subjects at wide apertures.<br/><br/><b>Fast quiet auto focus</b><br/>The ring USM (Ultrasonic Motor) drives extremely rapid auto focus with near-silent operation. Full time mechanical manual focus override is available without having to switch out of AF. The lens offers a minimum focusing distance of 0.3m.",
